import "./App.css";

import {
  Grid,
  Box,
  Typography,
  Button,
  CardMedia,
  CardContent,
  CardActions,
  Card,
} from "@mui/material";

import * as React from "react";

const mockEvents = [
  { name: "event1" },
  { name: "event2" },
  { name: "event3" },
  { name: "event4" },
  { name: "event5" },
];

function Events() {
  return (
    <Box padding={4}>
      <Box padding={2}>
        <Typography variant="h6">Events this week</Typography>
      </Box>
      <Grid container spacing={2}>
        {mockEvents.map((mockEvent) => (
          <Card sx={{ maxWidth: 345 }}>
            <CardMedia
              sx={{ height: 140 }}
              image="/static/images/cards/contemplative-reptile.jpg"
              title="green iguana"
            />
            <CardContent>
              <Typography gutterBottom variant="h5" component="div">
                Lizard
              </Typography>
              <Typography variant="body2" color="text.secondary">
                Lizard events
              </Typography>
            </CardContent>
            <CardActions>
              <Button size="small">Share</Button>
              <Button size="small">Learn More</Button>
            </CardActions>
          </Card>
        ))}
      </Grid>
    </Box>
  );
}

export default Events;
